        </div>
      </section>

      {/* Produk Terbaru */}
      <section className="products-section">
      <h2 className="section-title">Produk Terbaru</h2>
        <div className="products-grid">
          {[1, 2, 3, 4].map((item) => (
            <div key={item} className="product-card">
